class Solution(object):
    def countCompleteSubstrings(self, word, k):
        """
        :type word: str
        :type k: int
        :rtype: int
        """
        def isValid(sub):
            count = [0] * 26
            for c in sub:
                count[ord(c) - ord('a')] += 1
            for c in count:
                if c not  and c != k:
                    return False
            for i in range(1, len(sub)):
                if abs(ord(sub[i]) - ord(sub[i-1])) > 2:
                    return False
            return True

        n = len(word)
        result = 0
        for i in range(n):
            for j in range(i+k-1, n):
                if isValid(word[i:j+1]):
                    result += 1
        return result
